window.bookSummaryJSON = "<p><b>Harlow Shaw feels naïve for believing in happily ever afters, but she craves a love that lights her up.</b></p> <p>She thinks she has it all with her boyfriend—Until his promising baseball career overshadows their relationship, and he asks her a life-changing question. It causes her to wonder if what they have is all she ever truly wanted. Harlow is yearning for more than the curated life she is living.</p> <p>A trip to Bali, a move to Seattle, and an alleged burned cup of coffee lead her to a friendship she didn't know she needed and a love so deep she can feel it in her bones.</p>"; 
